import './Game.css';
import Card from './Card.js'

function Game() {
  return (
    <div>
        <div className="card-zone">
            <Card shape="triangle" color="yellow" number="3" shading="fill" />
            <Card shape="rectangle" color="red" number="2" shading="pattern-checker"/>
            <Card shape="triangle" color="yellow" number="3" shading="fill" />
            <Card/>
            <Card/>
            <Card/>
            <Card/>
            <Card/>
            <Card/>
            <Card/>
            <Card/>
            <Card/>
        </div>
    </div>
  );
}

export default Game;
